import './Main.css';
import book from './book.jpg';
function Upsc() {
  return (
  <>
  <div class="container" className="feature">
  <div class="row">
  <div class="col-sm-4">
	  <img src={book}/>
</div>
<div class="col-sm-6">
	  <h1>Our Newest Feature</h1>
	  <h3>Monthly Current Affairs Magazine -Edition Dec 2020</h3>
	  <button type="button">Download for free here</button>
	  <h4>You will get this monthly magazine when you enroll with us</h4>
</div>
</div>
   </div> 

  </>  	
  );
}

export default Upsc;
